    public static int lengthOfLongestSubstring(String s) {
        int lengthOfLongestStr=0;
        Map<String,Boolean> uniqueCharKeys;
        for(int i=0;i<s.length();i++){
                uniqueCharKeys = new HashMap<String,Boolean>();
                uniqueCharKeys.put(s.substring(i,i+1),true);
            
            for(int j=i+1;j<s.length();j++){
                        if(uniqueCharKeys.get(s.substring(j,j+1))!=null){
                            break;
                        }else {
                            uniqueCharKeys.put(s.substring(j,j+1),true);
                        }
            }
            
            if(lengthOfLongestStr<uniqueCharKeys.keySet().size()){
                lengthOfLongestStr=uniqueCharKeys.keySet().size();
            }
        }
        return lengthOfLongestStr;
    }
